import React , {Component, Fragment} from 'react'; 
import './App.css';

import Header from './components/header/Header';
import Content from './components/content/Content';
import Footer from './components/footer/Footer';

class App extends Component {

  render() { 
    return (
      // <Fragment>
      //     
      //     
      //     
      // </Fragment>

      <Router>
        <Header brandname="Company Name" />
        <Switch>
          <Route exact path="/" component={Home} />
          <Route path="/about" component={About} />
          <Route path="/contact" component={Contact} />
          <Route path="/i-want-to-hire" component={Hire} />
          <Route exact path="/i-want-to-work" component={Work} />
          <Route path="/i-want-to-work/step2" component={Work2} />
          <Route path="/employeeform" component={Employeeform} />
          <Route path="/kycform" component={Kycform} />
          <Route path="/agreementform" component={Agreementform} />
          <Route path="/workdashboard" component={Workdashboard} />
        </Switch>
        <Content />
        <Footer />
    </Router>
    );
  }
}

export default App;
